import{_ as e,o,c as a,N as t}from"./chunks/framework.7e203a6d.js";const r="/assets/chrome-desktop-download.fa378673.png",n="/assets/edge-desktop-download.2ab3df87.png",f=JSON.parse('{"title":"How to download GazePlotter?","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"advanced/download-gazeplotter.md"}'),l={name:"advanced/download-gazeplotter.md"},d=t('<h1 id="how-to-download-gazeplotter" tabindex="-1">How to download GazePlotter? <a class="header-anchor" href="#how-to-download-gazeplotter" aria-label="Permalink to &quot;How to download GazePlotter?&quot;">​</a></h1><p>GazePlotter, as a progressive web application (PWA), can be downloaded from the <a href="https://gazeplotter.com" target="_blank" rel="noreferrer">GazePlotter website</a>. The download is available for all the most of major desktop and mobile browsers.</p><p>On MacOS, the download of the PWA is available only in Chrome and Edge.</p><p>You can also fork or clone source code of GazePlotter from <a href="https://github.com/misavojte/gazeplotter" target="_blank" rel="noreferrer">GitHub</a>.</p><h2 id="pwa-app-on-windows-macos-linux" tabindex="-1">PWA app on Windows, MacOS &amp; Linux <a class="header-anchor" href="#pwa-app-on-windows-macos-linux" aria-label="Permalink to &quot;PWA app on Windows, MacOS &amp; Linux&quot;">​</a></h2><p>To download GazePlotter on desktop and laptops, click the install button in a search bar of a browser.</p><p>Down, you can see examples how the install button looked like in different browsers in April 2023. The button may look different in the future.</p><h3 id="chrome" tabindex="-1">Chrome <a class="header-anchor" href="#chrome" aria-label="Permalink to &quot;Chrome&quot;">​</a></h3><p><img src="'+r+'" alt=""></p><h3 id="edge" tabindex="-1">Edge <a class="header-anchor" href="#edge" aria-label="Permalink to &quot;Edge&quot;">​</a></h3><p><img src="'+n+'" alt=""></p><h2 id="pwa-app-on-android" tabindex="-1">PWA app on Android <a class="header-anchor" href="#pwa-app-on-android" aria-label="Permalink to &quot;PWA app on Android&quot;">​</a></h2><p>GazePlotter is available for download on mobile and tablets, too. Usually, the install button is located in the browser&#39;s menu. Sometimes, the install button is located in the browser&#39;s search bar.</p><h2 id="pwa-app-on-ios" tabindex="-1">PWA app on iOS <a class="header-anchor" href="#pwa-app-on-ios" aria-label="Permalink to &quot;PWA app on iOS&quot;">​</a></h2><p>For iOS iPhones and iPads, the download of the PWA is available only in Safari in April 2023. Press the share button and select <code>Add to Home Screen</code>.</p><h2 id="source-code" tabindex="-1">Source code <a class="header-anchor" href="#source-code" aria-label="Permalink to &quot;Source code&quot;">​</a></h2><p>You can also build and run the GazePlotter site from the source code. More on how to build the site from it is available in the <a href="./app-dev-build.html">Dev environment</a> section.</p>',17),i=[d];function s(p,h,c,u,m,b){return o(),a("div",null,i)}const _=e(l,[["render",s]]);export{f as __pageData,_ as default};
